        {
            id : 5,
            img: "data:image/jpeg;base64,"
        },
        {
            id : 6,
            img: "data:image/jpeg;base64,"
        },
    ]
    const productList = Products.map(person=> <h2>{person.id}</h2>)
  return (
    <div>productList</div>
  )
}

export default Products
